// frontend/src/AppRoutes.jsx
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Login from './pages/Login';
import AdminDashboard from './pages/admin/Dashboard';
import UsersManagement from './pages/admin/UsersManagement';
import GamesManagement from './pages/admin/GamesManagement';
import BranchesManagement from './pages/admin/BranchesManagement';
import Settings from './pages/admin/Settings';
import EmployeeDashboard from './pages/employee/Dashboard';
import Games from './pages/employee/Games';
import Rentals from './pages/employee/Rentals';
import AnalyticsPage from './pages/AnalyticsPage';
import ReportsPage from './pages/ReportsPage';
import Layout from './components/Layout';

// تأكد من أن جميع هذه الاستيرادات تعمل
// إذا كان أي منها غير موجود، أنشئ ملفاً بسيطاً له

const PrivateRoute = ({ children, roles = [] }) => {
  const userStr = localStorage.getItem('user');
  const token = localStorage.getItem('token');
  
  if (!token || !userStr) {
    return <Navigate to="/login" replace />;
  }
  
  let user = null;
  try {
    user = JSON.parse(userStr);
  } catch (e) {
    localStorage.removeItem('user');
    return <Navigate to="/login" replace />;
  }
  
  if (roles.length > 0 && !roles.includes(user.role)) {
    return <Navigate to="/login" replace />;
  }
  
  return children;
};

const AppRoutes = () => {
  return (
    <Routes>
      {/* Public Route */}
      <Route path="/login" element={<Login />} />
      
      {/* Protected Routes */}
      <Route path="/" element={
        <PrivateRoute>
          <Layout />
        </PrivateRoute>
      }>
        {/* Admin Routes */}
        <Route path="admin/dashboard" element={
          <PrivateRoute roles={['admin']}>
            <AdminDashboard />
          </PrivateRoute>
        } />
        
        <Route path="admin/users" element={
          <PrivateRoute roles={['admin']}>
            <UsersManagement />
          </PrivateRoute>
        } />
        
        <Route path="admin/games" element={
          <PrivateRoute roles={['admin']}>
            <GamesManagement />
          </PrivateRoute>
        } />
        
        <Route path="admin/branches" element={
          <PrivateRoute roles={['admin']}>
            <BranchesManagement />
          </PrivateRoute>
        } />
        
        <Route path="admin/settings" element={
          <PrivateRoute roles={['admin']}>
            <Settings />
          </PrivateRoute>
        } />
        
        {/* Employee Routes */}
        <Route path="employee/dashboard" element={
          <PrivateRoute roles={['employee', 'branch_manager', 'admin']}>
            <EmployeeDashboard />
          </PrivateRoute>
        } />
        
        <Route path="employee/games" element={
          <PrivateRoute roles={['employee', 'branch_manager', 'admin']}>
            <Games />
          </PrivateRoute>
        } />
        
        <Route path="employee/rentals" element={
          <PrivateRoute roles={['employee', 'branch_manager', 'admin']}>
            <Rentals />
          </PrivateRoute>
        } />
        
        {/* Shared Routes */}
        <Route path="analytics" element={
          <PrivateRoute roles={['admin', 'branch_manager']}>
            <AnalyticsPage />
          </PrivateRoute>
        } />
        
        <Route path="reports" element={
          <PrivateRoute roles={['admin', 'branch_manager']}>
            <ReportsPage />
          </PrivateRoute>
        } />
        
        {/* Default Route */}
        <Route index element={<Navigate to="/employee/dashboard" replace />} />
      </Route>
      
      {/* Catch all - redirect to login */}
      <Route path="*" element={<Navigate to="/login" replace />} />
    </Routes>
  );
};

export default AppRoutes;
